import React from 'react'
import { View, Text, FlatList, StyleSheet } from 'react-native'

export default function HomeScreen(){
    const menuItems = [
        {name: 'Item 1'},
        {name: 'Item 2'},
        {name: 'Item 3'},
        {name: 'Item 4'},
    ]

    return(
        <FlatList
            data = {menuItems}
            numColumns = {3}
            renderItem = {({item}) => (
                <View style={styles.container}>
                    <View style={styles.circle}></View>
                    <Text>{item.name}</Text>
                </View>
            )
            }
        >
        </FlatList>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    circle: {
        height: 60,
        width: 60,
        borderRadius: 60 /2,
        backgroundColor: 'red'
    }
})
